webpackJsonp([0x764e1b384914],{1343:function(a,t){a.exports={data:{site:{siteMetadata:{title:"Psyked: James' Web Development website",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/win-a-copy-of-the-flash-facebook-cookbook-at-my-flashmidlands-session-this-saturday/index.md absPath of file >>> MarkdownRemark",html:'<p>On Saturday 19th November I\'ll be doing a session on <a href="/tag/the-flash-facebook-cookbook">the Flash Facebook Cookbook</a> at the <a href="http://www.flashmidlands.com/2011/10/next-meeting-warwick-university-date-tbc/">FlashMidlands meetup</a>, and will have a copy or two of the book to give away.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/packt-presentation-b1b514899e48191b2324d57056bf8820-41a8d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 55.99999999999999%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="packt presentation"\n        title="FlashMidlands presentation"\n        src="/static/packt-presentation-b1b514899e48191b2324d57056bf8820-41a8d.png"\n        srcset="/static/packt-presentation-b1b514899e48191b2324d57056bf8820-bf474.png 158w,\n/static/packt-presentation-b1b514899e48191b2324d57056bf8820-d5dd3.png 315w,\n/static/packt-presentation-b1b514899e48191b2324d57056bf8820-41a8d.png 500w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>In the session I will be looking at working with the Facebook Graph API and Flash. Starting where the Flash Facebook Cookbook starts we’ll cover relevant background theory on how the APIs work – how to authenticate applications and obtain access tokens, how to request data from, and send data to Facebook, and how to obtain Extended Permissions from the user.</p>\n<p>I’ll be using Flash Builder and the Flex framework to show examples of how everything works in practice, and then we’ll have a look at the possibilities and limitations of what you can do with Flash and Facebook.</p>\n<p>If that sounds fun, and you\'re in the UK, and you can get to Warwick on Saturday, join me! </p>\n<blockquote>\n<p>I\'m terrified enough by the idea of giving a presentation, so more people can\'t hurt!</p>\n</blockquote>',frontmatter:{title:"Win a copy of the Flash Facebook Cookbook, at my FlashMidlands session, this Saturday.",date:"November 15, 2011",tags:["the-flash-facebook-cookbook"],url:null,image:null,description:null}}},pathContext:{prev:{frontmatter:{path:"/blog/corona-sdk-solving-json-decode-error-with-utf-8-files/",tags:["encoding"],title:"Corona SDK: Solving JSON decode error with UTF-8 files.",date:"2011-11-14T21:41:45.000Z"}},next:{frontmatter:{path:"/blog/the-slides-from-my-presentation-at-flashmidlands/",tags:["actionscript","facebook","flash","presentations","the-flash-facebook-cookbook","flashmidlands"],title:"The slides from my presentation at FlashMidlands.",date:"2011-11-20T20:50:42.000Z"}}}}}});
